function processDelegatedTransaction(
    address userAddress,
    uint8 v,
    bytes32 r,
    bytes32 s,
    uint16 param1,
    uint16 param2
) public requireOwner {
    bytes32 msgHash = keccak256(abi.encodePacked(param1, param2));
    require(userAddress == ecrecover(msgHash, v, r, s));
}

